l)	Rozliczenia międzyokresowe przychodów

Rozliczenia międzyokresowe przychodów dokonywane są z zachowaniem zasady ostrożnej wyceny i obejmują w szczególności: 
- równowartość otrzymanych lub należnych od kontrahentów środków z tytułu świadczeń, których wykonanie nastąpi w następnych okresach sprawozdawczych. Spółka prezentacyjnie w bilanse wykazuje otrzymane zaliczki na poczet przyszłych świadczeń w "Zobowiązaniach krótkoterminowych" jako "Otrzymane zaliczki".
- środki pieniężne otrzymane na sfinansowanie nabycia lub wytworzenia środków trwałych, w tym także środków trwałych w budowie oraz prac rozwojowych, jeżeli stosownie do innych ustaw nie zwiększają one kapitałów własnych. Zaliczone do rozliczeń międzyokresowych przychodów kwoty zwiększają stopniowo pozostałe przychody operacyjne, równolegle do odpisów amortyzacyjnych lub umorzeniowych od środków trwałych lub kosztów prac rozwojowych sfinansowanych z tych źródeł;
- wartość przyjętych nieodpłatnie, w tym także w drodze darowizny, środków trwałych w budowie, środków trwałych oraz wartości niematerialnych
i prawnych. Zaliczone do rozliczeń międzyokresowych przychodów kwoty zwiększają stopniowo pozostałe przychody operacyjne, równolegle do odpisów amortyzacyjnych lub umorzeniowych od środków trwałych lub wartości niematerialnych i prawnych;
